  \"2016-11-25T21:06:29.890817\",\n\t\"name\": \"200304-national-postsecondary-student-aid-study\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The National Postsecondary Student Aid Study,
  2003-04 (NPSAS:04), is a study that is part of the National Postsecondary Student
  Aid Study (NPSAS) program. NPSAS:04 (http://nces.ed.gov/surveys/npsas/about.asp)
  is a cross-sectional survey that is designed to compile a comprehensive research
  dataset, based on student-level records, on financial aid provided by the federal
  government, the states, postsecondary institutions, employers, and private agencies
  along with student demographic and enrollment data. The study was conducted using
  multiple sources, including institutional records, government databases, and student
  interviews. NPSAS:04 contains the data on a sample of about 109,210 postsecondary
  students who were enrolled at any time between July 1, 2003 and June 30, 2004 in
  about 1,670 postsecondary institutions. The data are representative of all undergraduate
  and graduate students enrolled in postsecondary institutions in the 50 United States,
  the District of Columbia, and Puerto Rico that were eligible to participate in the
  federal financial aid programs in Title IV of the Higher Education Act. Statistics
  produced from the NPSAS:04 provide reliable national estimates of characteristics
  related to financial aid for postsecondary students.\",\n\t\"license_title\": \"Creative
